import React, { Component } from 'react';
import './App.css';
import BarChart from './components/barChart';


class App extends Component {
  render() {
    return (
      <React.Fragment>
          <div id="svg1"></div>
          <BarChart />
      </React.Fragment>
    );
  }
}

export default App;
